(85, 'Fadillah ', 'Gresik', '1998-11-21', 150, 50, 'A', 'Tidak', 'Pelajar', 0, 'Ismail', 'Indonesia', 'Lafiani', 'Indonesia', 'Belum', 'Gresik', 'Sdn kedamean', 'Smp gresik', 'Sma lamongan', 'S1 kedokteran gigi unej', 'Tidak ada', 'Palang merah remaja', 'Tidak', 'Tidak bekerja', 'Aku orangnya suka dengan berbau yang menantang. Ingin merasakan berbagai macam pengalaman mengubah diriku menjadi orang yang bermanfaat.  Aku ngk suka melihat lingkungan sekitar kotor. Jadi aku bersihkan bila lingkungan disekitarku kotor.  Aku orangnya gampang yersinggung dan mudah menangis.  Aku senang bila orang yang disisiku nerima kekurangan dan kelebihan yang ada di dalam diriku.  Tidak memandang dengan nama orang rua ku saya.  Dan bisa menjadi imam yg baik buat diriku kelak. Dan ingin membahagiakan kedua orang tua', 'Menjadi diri sendiri', 'Membaca buku', 'Novel', 'Facebook', 'Nabi muhammad saw', 'Membersihkan lingkungan', 'Selalu fibandingkan dengan orang lain', 'Mandiri,  disiplin, jujur, baik, penyayang', 'Mudah tersinngung,  mudah marah mudah nangis mudah tidur mudah sakit', 'Tidak', 'Iya', 'Ayahku adalah seorang ayah yang terhebat buatku.  Beliau yang mengajarkan aku arti sebuah kehidupan nyata.  Dia sering menasehatiku hidup di dunia hanya fata morgana jadi jangan mengejar kehidupan tapi kejarlah akhirat. Karena akhirat lah tempat kita yang abadi.  Ayah sangat menyayangi ku ayah rela bekerja sampai larut malam demi keluargaku. Walaupun ayah sedih tapi kesedihan itu tidak akan nampak bila berhadapan dengan anaknya.  Aku sangat sayang ayah.  Ayah sekarang dipanggil allah.. Aku akan berjuang membahagiakan hati ayah walaupun ayah tidak ada disampingku lagi', 'Ibu ada orang yang paling mulia. Ibu lah yang melahirkan kita mengandung kita.  Ibu sangat perhatian ke kita semua.  Dia rela bangun pagi bila kita terbangun pada malam hari.  Perjuangan ibu sangat luar biasa.  Dia akan bahagia bila melihat anaknya bajagia.  Aku sangat menyayangi kedua orang tuaku.. Walaupun funia ibu ku tdk sempurna tapi bagiku ibuku adalah orang yang mulia dan sempurna buat hidupku.  Aku hidup untuk ibu dan ayah.  Aku akan berjuang agar hari tua ibu menikmati hasil jetih payah ibu selama ini. ', 'Saudaraku sangat menyayangiku dengan sepenuh hati aku sangat menyayanginya. \r\n\r\n\r\nAku akan menjaga saudaraku. Kakakku yang selalu menjagaku\r\nAdekku selalu menyayangi. \r\nAdekku emng sedikit bandel.  Tapi dia selalu buatku senang dengan perhatiannya.. Aku lupa dengan kesedihanku.. Canda tawa kita bila verkumpul.  Aku skan selalu menjaga adekku mematuhi nasejat kakaka.  \r\n\r\n\r\nAku sangat menyayangi mereka berdua.  Seperti aku sayang kepada ayah dan ibuku. \r\nBmerekalah yang membuat semangat dalam menjalanai kehidupa', 'Tidak', 'Nasi goreng', 'Jus jambu', 'Jam 10', 'Alhamdulillah ', 'Shalat tahajud dhuha puasa shlat hajat', 'Bisa', 'Iya', 'Istighosah', 'Membaca al quran', 'Baik', 'Ada', 'Belum', 'Belum', 'Belum', '3 bulan', 'Vusi', 1, 1, 1, 1, 'Baik jujur dan menjadi iman yang baik', 'Yang baik ahlak nya dan juga agamanya', 'Tidak tau', 'Tidak tau', 'Sakina mawada ma rahma', 'Dokter gigi', 'Sabar ', 'Meneliti', 'Sukses dokter gigi s2 dijepang.  Ingin mendapat pekerjaan yang layak.  Bahagiakan orang tua. Menikah', 'Menjaga keluarga dan orang tua', 'Hidup itu dijalanin kita hanya bisa berikhtiar', '085748426642'),
