(99, 'Diah wijayanti', 'Surabaya', '1992-11-23', 150, 55, 'O', 'Tidak', 'Staf Admin', 3, 'Bambang sukardi', 'Jawa', 'Suharti', 'Jawa', 'ya', 'Sidotopo lor 1 no.3 surabaya', 'Sdn sidopoto II no.49sby', 'Smpn 11 surabaya', 'Smk muhammadiyah 1 sby', 'D3- akuntansi Stiesia ', 'Belum ada prestasi juara di sekolah', 'Osis sma', 'Tidak pernah', 'Staf admin ud.airmas 2011-sekarang', 'Saya adalah anak ke4 dari 4bersaudara 3kakak saya laki2,saya sendiri yg perempuan dan ank terakhir, saya berasal dari keluarga sederhana ayah saya seorang satpam dan ibu saya sebagai ibu rumah tangga, aktivitas sehari2 saya bekerja pagi hari smpai jam4sore dan kuliah di malam hari di stiesia.', 'Apa saja akan saya lakukan selama itu benar untuk cita2 membahagiakan kedua orang tua saya', 'Membaca mendengarkan musik bernyanyi', 'Novel ', 'Website yang berisi pengetahuan yang penting terkait apapun termasuk kuliah saya.', 'Ayah dan ibu saya ', 'Bekerja kalau senggang bermain handphone mendengarkan musik', 'Dengan orang2 yang berusaha mengganggu hidup saya, marah kepada saya hal2 yang membuat mood saya tidak bagus saya tidak suka.', 'Mandiri, tidak mudah menyerah, jujur, suka memberi masukan pada teman, perhatian ', 'Terkadang suka ngambek, malas kadang2, terkadang masih sperti anak kecil, ', 'Tidak hanya saya gemuk dan pendek', 'Tidak', 'Ayah saya seorang pekerja keras tidak mudah menyerah menjalani hidupnya meskipun terkadang dalam keadaan susah, ayah saya adalah panutan yg baik untuk hidup saya', 'Ibu saya dulu seorang pekerja keras berjualan di pasar tetapi kemudian bankrut karena pelanggan tidak bisa membayar hutang nya. Jadi sekarang menjadi ibu rumah tangga dirumah menjalani peran seorang ibu.', 'Kakak saya laki2 ada 3orang semua sudah bekerja. Kakak kedua dan ketiga sudah menikah dan memiliki anak. Kakak pertama saya akan menikah dalam waktu dekat. ', 'Tidak', ' Nasi pecel mie ayam dan makanan yang lain yang halal', 'Air putih', 'Jam 11 malam', 'Terkadang masi suka bolong bolong', 'Puasa', 'Bisa', 'Tidak banyak tapi ayat2 yang pendek saya bisa', 'Tidak pernah', 'Membantu orang tua aktivitas dirumah dan jalan2 saat bosan di rumah ', 'Baik baik saja', 'Pernikahan adalah hal yang suci sakral. Sekali seu', 'Belum', 'Belum ada persiapan karena saya masih menyelesaika', 'Sudah', '2tahunan atau 1,5tahun', 'Menjadikan pernikahan yang bahagia yang bisa menerima kekurangan kelebihan masing2 untuk melangkah bersama menjadikan pernikahan sebagai ibadah dan jalan untuk mendapatkan kebahagiaan untuk keluarga juga, yang terus menjalani pernikahan suka duka senantiasa bersama-sama saling mendukung satu sama lain agar kebahagiaan senantiasa ada dan pernikahan bisa langgeng sampai ajal menjemput.', 1, -1, 0, 1, 'Yang memiliki perilaku baik, tidak pernah melakukan kejahatan apapun, yang memperhatikan keluarganya terutama orangtuanya, bertanggung jawab, perhatian, setia, bisa menerima keadaan dan kekurangan saya dan bisa menerima keluarga saya apa adanya tidak menuntut hal yang lebih yang saya tidak mampu untuk melakukannya.', 'Yang baik, bertanggung jawab, perilakunya baik mengerti patuh terhadap orang tua, mencintai perhatian dengan saya, bekerja yang baik dan senantiasa memperhatikan saya dan menerima saya apa adanya dengan kekurangan saya.', 'Acara pernikahan sederhana yang semestinya tidak perlu mewah karena saya juga bukan dari keluarga mampu atau kaya.', 'Surabaya atau tempat tinggal suami saya nanti akan dipikirkan kembali.', 'Rumah tangga yang bahagia dengan suami yang perhatian setia dengan saya, mau menerima kondisi saya apa adanya, suka duka mau menjalani bersama sama,bertanggung jawab dengan saya dan anak anak saya kelak dan mau perhatian juga dengan orang tua saya.', 'Saya tetap ingin bekerja tetapi jika suami ingin saya sebagai ibu rumah tangga saya tidak masalah.', 'Dengan mendidik sebaik mungkin, mengajarkan hal-hal yang baik dengan paud, sekolah belajar dirumah dan didikan baik yang lain.', 'Sebisa mungkin pengeluaran untuk kebutuhan berumah tangga, dan menaruh uang ditabungan sebisa mungkin untuk ditabung untuk kebutuhan keluarga yang mendadak dan masa depan anak anak nantinya.', 'Menikah memiliki suami yang bertanggung jawab memiliki anak yang cerdas yang baik, bisa membahagiakan kedua orang tua saya memiliki kehidupan yang lebih baik daripada kehidupan saya sekarang.', 'Memiliki rumah sendiri berumah tangga yang baik membahagiakan suami dan anak anak saya kelak, semoga orang tua saya bisa saya bahagiakan terus mendampingi saya dan saya bisa memberikan yang terbaik untuk suami anak anak dan keluaega sya', 'Menjalani hidup pantang menyerah menjalankan hal yang positif senantiasa berusha selalu bersyukur membantu org lain jika saya mampu, menjalankan hidup sebaik mungkin.', '083114207764'),
(100, 'Fitriah Ilmi', 'Bogor', '1993-02-09', 150, 45, 'O', 'Tidak', 'Asisten dosen', 3, 'Dedy', 'Betawi', 'Ika', 'Sunda', 'ya', 'Bogor', 'SDIT Ummul Quro Bogor 1999-2005', 'SMPIT Ummul Quro Bogor 2005-2008', 'SMK Tri Dharma 2 Bogor jurusan Multimedia 2008-201', 'D3 Manajemen Informatika Institut Pertanian Bogor 2011-2014\r\nS1 Teknik Informatika Universitas Indraprasta (baru masuk Februari 2017, masih kuliah setiap hari Sabtu)', '-Pemenang photo of the week obscura\r\n-Pemenang kompetisi fotografi di grup Nikon D5100\r\n-Top 50 di seller incubator program bukalapak.com\r\n-Pemenang Nikon Indonesia Meet & Greet di Instagram\r\n-Campus Ambassador paling antusias di Carousell.com', 'Lumayan banyak yang pernag diikuti, tapi yang masih berjalan sampai saat ini:\r\n-Dreamdelion Cerdas sejak 2014\r\n-Urban Sakola sejak 2015\r\n-Kujang Fotografi sejak 2015', 'Pernah dong, salah satunya di tahun 2016 jadi koordinator dokumentasi event bukalapak.com di Bogor Kuring. Selain membuat tim fotografer, saya juga mencarikan MC, dan mempromosikan event tersebut. Acara lancar dan dihadiri CEO bukalapak dan Walikota Bogor. Sayangnya tim fotografer yang saya datangkan kurang bertanggung jawab atas foto yang tersimpan. Dengan alasan terkena virus, foto-foto tersebut tidak dikumpulkan. Jadi hanya ada foto dari kamera saya saja. Meskipun begitu, tim komunitas bogor dan bukalapak pun dapat memahaminya.', 'Sampai saat ini, baru jadi asisten dosen di IPB. Sambil asdos, pernah punya pengalaman proyek di Adira Finance 2 bulan. Kalau sebelumnya hanya magang saja bukan kerja, yaitu di Radio Sipatahunan dan Trans TV.', 'Aku orangnya simpel, tidak suka basa-basi, memuji secukupnya, asyik diajak bicara, suka film animasi, suka kuliner, tidak suka kepanasan (kalau terlalu panas suka pusing dan marah), & bukan dari keluarga kaya. Hehe', 'Bersyukur atas segala nikmat Allah, bisa banggain diri sendiri, sayang keluarga, & punya kehidupan y', 'Main game, kulineran, fotografi, dan jalan-jalan', 'Line Today dan Cleo', 'Cleo', 'Mama', 'Upload foto di online shop', 'Dihina, dimarahin, dan diomongin di belakang', 'Selalu bersyukur, mau belajar hal baru, pendengar yang baik, pengamat aktivitas, dan humoris', 'Kadang malas, kalau kepanasan suka marah, kurang percaya diri, tidak bisa memulai obrolan (tapi kalau sudah dimulai langsung asyik diajak ngobrol), & kadang-kadang penakut ', 'Alhamdulillah fisik normal, tapi tinggi aku tidak seperti model, hehe.', 'Alhamdulillah netral. Tidak fanatik pada sesuatu, ', 'Jarang ketemu. Sudah cerai sama mama. Sebelum cerai juga tidak terlalu dekat karena beliau jarang di rumah. Kalau akad nikah dalam Islam kan papa kandung wanita harus hadir, beliau bisa hadir. Namun, untuk kegiatan sehari-hari beliau susah dihubungi. ', 'Waw, mama yang baik hati dan sabar. Tidak suka buka aib keluarga. Super keren! Selalu mengajari anaknya hal baik, termasuk tetap hormat sama papa. Mama selalu positif thinking dan rajin beribadah.', 'Kakakku cuma satu, laki-laki. Orangnya baik, tapi kadang cuek. Hobi belanja dan koleksi jam tangan. Hobi main games dan nonton. Rajin bekerja dan sayang keluarga.', 'Tidak dan tidak suka pria merokok. ', 'Aku suka makanan yang asin, seperti udang, kangkung, dan teri.', 'Coklat panas dan es jeruk', 'Tergantung, yang penting abis shalat isya baru tidur.', 'Alhamdulillah lancar, tapi kadang nyesel kalau telat. Misalkan baru bisa shalat zuhur jam dua.', 'Shalat dhuha', 'Bisa dong', 'Iya, tapi suka lupa lagi. Jadi suka diulang hafalannya.', 'Kalau nonton di TV seperti acara mama dan Aa. Kalau yang didatangi pengajian tiap awal bulan bareng PPPA Daqu di masjid alumni IPB. ', 'Ngobrol sama temen lewat sosmed, baca berita apapun, dan main games', 'Baik-baik saja. Temen dari SD sampai kuliah masih hobi chat kok.', 'Saling mengurusi, saling percaya, dan saling menci', 'Kalau di adat keluargaku, semua biaya pernikahan d', 'Belajar masak, baca-baca artikel tentang bisnis da', 'Kalau keluargaku, kalau aku mau dan siap ya boleh.', 'Tergantung prosesnya tersebut. Belum bisa ditentuk', 'Menjadi keluarga yang sakinah, mawadah, dan warrahmah. Bisa membawa rezeki yang lebih  baik dan halal. Tidak menyusahkan ortu. Hidup bahagia di dunia dan akhirat.', 0, 1, -1, 0, 'Ibadahnya yang rajin, tampan, cerdas, rajin, baik hati, dan berkecukupan harta. ', 'Ibadahnya yang rajin, punya usaha atau kerja yang menghasilkan, bisa mendidik aku lebih baik, sayang keluarga, dan tidak menyusahkan ortu.', 'Acaranya ditentukan setelah mendengarkan dan diskusi dengan keinginan pihak pria. Karena aku tidak menuntut banyak, yang penting mahar sesuai dan sah. Karena aku lebih suka jadi ratu selamanya di kehidupan sehari-hari, daripada jadi ratu sehari di pesta pernikahan.', 'Ikut suami di rumah sendiri, tapi kalau lokasi jauh dari kampus, mungkin setiap weekend izin pergi ke Jakarta.', 'Kehidupan yang damai, menyenangkan, seru, bisa jalan-jalan bareng, saling mengerti, tidak melarang pendidikan istri, dan kalau ada masalah saling dibicarakan atau setiap sebulan sekali diadakan sesi curhat khusus berdua.', 'Aku bisa full di rumah, mengurusi rumah tangga dan anak-anak. Supaya aku tidak bosan, aku buka online shop saja. Pokoknya tergantung suamiku lebih suka gimana.', 'Dengan didikan Islam yang baik dan menyenangkan.', 'Penghasilan dari suami itu dibagi beberapa hal, yaitu kebutuhan per bulan, kasih ortu, kasih mertua, dan tabungan.', 'Menjadi istri yang sholehah, mama yang baik, sukses di bisnis, dan bisa lanjut S2.', 'Pernikahan tetap harmonis, masih suka nge-date, penghasilan suami bertambah, dan rukun sama keluarga.', 'Bisa dikenal oleh babyak orang dalam hal positif, menikah dengan orang yang dicintai, punya anak-anak yang lucu dan rajin beribadah. Dicukupkan umurnya untuk mendapatkan pahala.', '083811126424'),
