(142, 'Nova', 'Palembang', '1991-11-28', 158, 50, 'B', 'Tidak', 'Honorer', 3, 'Ibrahim', 'Palembang', 'Yayah rokayah', 'Sunda', 'ya', 'Kampung lio rt  03 rw 19 no 66 keluran depok kecamatan pancoran mas 16431', 'SDN 15 sungailiat bangka', 'SMP N 5 sungailiat bangka', 'SMA SETIA BUDI SUNGAILIAT BANGKA', 'Universitas djuanda bogor', 'Tidak ada ', 'Bendahara Himpunan mahasiswa manajemen.', 'Saya pernah menjadi panitian BIMTEK. Dimana saya harus mendata orang sebanyak 200 lebih orang dari berbagai daerah. Mengatur kamar,absen para peserta. Sampai harus tidur diatas jam 3. Pagi harus bangun lagi. Itu pengalaman yang luar biasa buat saya.', 'Honor di kementerian desa pdt dan transmigrasi dari 2013 sampai sekarang', 'Saya seorang anak dari keluarga sederhana, saya anak ke 2 dari dua bersaudara. \r\nSaya suka masak, suka traveling, baca buku. \r\nSaya orang ny tepat waktu.\r\nGak suka ngeliat rumah berantakan.', 'Moto hidup saya, dari Allah untuk Allah dan kembali lagi pada Allah', 'Hobi saya masak,olah raga, traveling', 'Terre liye', 'Blog masak. Dan info tempat traveling', 'Ibu saya', 'Masak dan traveling', 'Gak suka menunggu, di bohongin. ', '1.Penyayang, sabar, suka anak anak, ', 'Gak bisa ngeliat orang susah, kadang gampang emosian tapi cepat reda nya.', 'Tidak ada', 'Tidak', 'Ayah saya orang yang baik, tapi dia seorang ayah yang tegas kalau dalam mendidik anak nya. \r\nAyah yang hobi mancing dan berkebun. \r\nAyah yang baik,ayah yang memimpin keluarga dengan baik. Dia bekerja banting tulang buat menghidupi keluarga nya. ', 'Ibu saya seorang ibu rumah tangga.\r\nibu adalah orang yang baik,penyayang.\r\nIbu tidak suka marah marah. \r\nIbu saya pintar masak.\r\nIbu yang sabar. \r\nIbu tempat curhat anak anak nya.\r\n', 'Saya mempunyai kakak perempuan satu satu nya. Dia kakak yang baik buat saya, teman cerita,teman main,teman yang bisa di ajak bercanda,tapi kandang serius. ', 'Tidak', 'Nasi goreng, ikan di asam manis, sambal,dll', 'Air putih dan jus alpukat', 'Jam 21.00', 'Insya Allah selalu tepat waktu dalam beribadah', 'Tahajud dan dhuha.', 'Ya', 'Hanya surat surat pendek dan lagi belajar untuk bisa menghafal Al-quran', 'Tidak rutin,. Paling kalau saya ada waktu saya baru ikut', 'Masak,beres beres rumah. Main sama anak sepupu', 'Sangat baik', 'Pernikan itu menyatukan dua keluarga menjadi satu,', 'Insya Allah saya siap', 'Persiapan mental, agama, persiapan dalam diri menj', 'Ya', '3 sampai 4 bulan. ', 'Visi: mengenapkan separuh agama untuk mewujudkan rumah tangga yang SAMAWA. \r\nMisi: saling mengingatkan dalam beribadah, bersama sama mempelajari ilmu agama, bersama sama dalam menjaling hubungan baik dengain banyak orang.', 1, 1, 1, 1, 'Yang sayang dengan keluarga,mempunyai pekerjaan, agama nya baik, bisa membimbing istri nya menjadi seorang istri yang lebih baik lagi', 'Mempunyai pekerjan tetap,agama nya baik,sayangbdengan keluarga saya', 'Pernikahan yang sederhana.  Tapi nanti tergantung kesepakatan bersama dalam kedua belah pihak.', 'Ikut suami', 'Keluarga yang sederhana,  selalu menjaga keharmonisan rumah tangga, ada keterbukaan antar suami istri apabila ada masalah. ', 'Ingin tetap bekerja,.', 'Saya akan mendidik anak dengan mengajarkan agama yang baik buat anak saya nanti. Memberikan kesibukan yang sesuai untuk anak, membiasakn anak untuk bangun di akhir malam, memberikan kesempatan anak untuk memperbaiki kesalahan.mengingatkan kebaikan pada anak.', 'Belanja kebutuhan rumah tangga, hutang, tabungan, zakat atau sedekah. Membuat kebutuhan jangka panjang dan jangka pendek,. Mencatat penghasilan, Mencatat pengeluaran bulanan.mencatat pengeluaran tahunan.', 'Target 5 tahun kedepan, lebih mendalami ilmu agama islam, mempunyai bisnis sendiri. Mempunyai keluarga yg harmonis, ingin berwisata bersama keluarga, ingin mempunyai yayasan yang bisa mengajarkan anak anak yang kurang mampu. ', 'Mempunyai yayasan yang bisa membantu dan mendidik anak anak kurang mampu. ', 'Visi: meraih kesuksesan dunia dan akhirat. Membahagiakan orang tua, bermafaat bagi orang lain.\r\nMisi: taat kepada Allah. Taat kepada orang tua. Jujur. Dapat meraih kesuksesan.', '087874277095'),
