(169, 'Rahayu Subekti', 'Bogor', '1992-08-09', 165, 75, 'A', 'Tidak', 'Reporter', 3, 'Subekti', 'Jawa ', 'Sulastri', 'Jawa', 'ya', 'Depok', 'SDN Harjamukti III', 'SMP Taruna Bhakti', 'SMA PKP Jakarta Islamic School', 'S1 Jurnalistik IISIP Jakarta 2009', 'Hmm belum ada. ', 'Ketua Majalah GREST SMA 2007/2008\r\nBendahara Paduan Suara IISIP 2010/2011', 'Waktu itu lagi buat acara paduan suara tingkat SMA se-Jakarta. Saya jadi koordinator acara. Dari situ belajar banyak soal manage apapun. ', 'Reporter di Koran Republika 2010 s.d sekarang', 'Saya orang yang lumayan perfeksionis. Menikmati sekali sama pekerjaan sekarang. Sekarang benar-benar lagi cari banyak ilmu sekaligus proses jadi muslimah.', 'Serahin semuanya sama Allah SWT', 'Nulis', 'Ga ada yang spesifik. Intinya buku jenis apa saja yang menarik.', 'Semua website yang berhubungan sama kerjaan. ', 'Ibu', 'Nulis selebignya ga terlalu ada yang spesifik. Apa aja yang bermanfaat. ', 'Bohong. ', 'Mau berjuang. Mau mendengarkan. Tidak pemarah. ', 'Cepat bad mood. Pelupa. Buru-buru', 'Kekurangan secara cacat tidak. ', 'Tidak', 'Bapak saya pensiun. Dia lumayan sudah tua umurnya hampir menginjak 73 tahun. Cukup tegas. Termasuk sedikit egois tapi dia punya kepribadian yang lumayan hunoris. ', 'Ibu dekat sekali dengan saya. Dia ibu rumah tangga bukan pekerja. Selalu tanya kegiatan saya kalau lagi tidak di rumah. Dia selalu perhatian terutana dengan semua keperluan saya. ', 'Saya anak tunggal. Tidak punya kakak atau pun adik. Tapi saya punya dua sepupu yang lumayan dekat. Mereka seemua perenpuan dan sudah saya anggap sebagai kakak sendiri. ', 'Tidak', 'Mie goreng', 'Air putih dingin', 'Jam 21.00', 'Saya taat untuk ibadah sholat lima waktu. ', 'Solat tahajud dan puasa senin kamis. ', 'Bisa', 'Tidak', 'Kerja saya yang cukup menyita waktu membuat saya jarang menemukan waktu yang cocok untuk kajian. Tapi saya selalu mendengarkan kajian sunnah di youtube. ', 'Waktu luang saya biasanya di atas jam magrib. Saya suka sempatkan baca Alquran meski cuma 10 ayat. Selebihnya saya gunakan istirahat. Kalau waktu libur saya sempatkan juga olahraga. ', 'Baik. Saya punya beberapa teman dekat baik teman kerja atau temen-teman kuliah saya yang sampai saat ini masih bertemu. ', 'Perbikahan seperti melengkapi agama saya. Lewat pe', 'Belum. ', 'Secara materil belum. Lebih kepada ilmu karena say', 'Sudah', 'Secepatnya jika cocok', 'Visi: Menjadi keluarga yang kembali dipertemukan di surga\r\n\r\nMisi: Menjadi keluarga yang sakinah mawardah wa rahmah. ', 1, 1, -1, 1, 'Sholeh', 'Sholeh dan bisa hidup bersama untuk menjadi lebih baik dalam segala hal', 'Sederhana', 'Depok atau Jakarta', 'Kehidupan rumah tangga yang islami namun tetap terbuka dengan beragam hal', 'Menjadi ibu rumah tangga. Hanya saja kalau pendapatan suami belum cukup, saya masih mau bekerja. ', 'Secara islami. Ibu merupakan sekolah pertama bagi anak. Saya mau sejak kecil anak saya paham ilmu agama. ', 'Semua dikondisikan. Tapi saya mau meski ada pengeluaran tetap ada tabungan untuk masa depan atau hal yang di luar rencana. ', 'Menikah, jadi perempuan lebih baik, bisa mencicil rumah, bisa jadi redaktur, punya anak. ', 'Bisa jadi ibu rumah tangga dan kalau bisa punya bisnis sendiri', 'Visi: Masuk Surga bersama orang yang dicintai. \r\n\r\nMisi: Melakukan segala hal namun tetap membawa ajaran agama untuk bertindak. ', '085780054157'),
