(173, 'Amelia Husnan', 'Surabaya', '1995-09-24', 157, 54, 'O', 'Tidak', 'Mahasiswi', 3, 'Amir Husnan', 'Madura', 'Ritha Hendrawaty', 'Jawa', 'ya', 'Jln. MT haryono no 139', 'SDN Badean 1', 'SMP Negeri 4 Bondowoso', 'SMA Negeri 2 Bondowoso 2010-2013', 'Universitas Brawijaya 2014', 'Tidak ada', 'Anggota divisi kaderisasi', 'Panitia Program Pembinaan Mahasiswa Baru sebagai Steering Comittee\r\nPenanggung Jawab acara lomba di Jurusan\r\nBendahara acara sanitasi desa\r\nPenari dalam acara hari air dunia', 'Magang saja di kampus', 'Aku adalah seorang mahasiswi. Tapi entah mengapa cita-citaku bukan untuk menjadi wanita karir yg memiliki pekerjaan tetap. Tapi mempunyai sebuah keluarga yang utuh dan menjadi seorang ibu rumah tangga bukan cita2 yang buruk bukan?', 'Berjalan dengan ridho Allah', 'Memasak', 'Aku Tinggalkan Dia Karena Dia', 'Situs dakwah kajian islami', 'Muhammad SAW tepatnya tapi dengan segala kekurangan saya jika banyak lupa', 'Memasak, Olahraga pagi, Belanja ke pasar, Mendengar Kajian di Instagram', 'Bertemu orang tua dirumah', 'Penyayang, hemat, peka, tidak tegaan, berani memulai sesuatu yang baru setelah menyerah', 'Tidak sabaran, gampang baper karena terlalu peka, kurang penyabar, emosi sesaat', 'tidak', 'tidak', 'Ayah saya lahir di madura. Beliau seorang yang keras dan agamis karena keluarga besar ialah keturunan kyai. Beliau bekerja sebagai staf perencanaan pengairan', 'Ibu saya lahir di surabaya. Beliau pintar  dan jago memasak dan membuat jajanan kue. Ya itulah karna ibu saya adalah ibu rumah tangga. Ibu saya sederhana dan tuntutannya tidak banyak tapi hanya lakukan terbaik sesuai dengan tuntutan Allah saja', 'Aku hanya punya 1 saudara laki2. Dia sudah lulus SMA tapi tidak ingin lanjut kuliah tapi hanya bekerja bersama dengan ayah saja. Karena alasan dia ingin menjaga ibu agar tidak kesepian dirumah apalagi saya kuliah diluar kota', 'tidak', 'sup', 'air putih', 'jam 10', 'alhamdulillah', 'tahajud dan puasa senin kamis', 'bisa', 'jarang', 'kajian dikampus saja tapi tidak sering', 'memasak dan nonton film', 'kemana mana dengan sahabat saja. karena saya tipikal susah bergaul jika tidak cocok dengan karakter saya.', '1x untuk didunia dan di akhirat', 'belum', 'mental dan pengetahuan', 'jika ada ', 'Sampai lulus kuliah', 'Visi jangka panjang : menjadi keluarga sakinah mawaddah dan warohmah dengan ridho Allah dan orang tua\r\nMisi : \r\n- menjadi ibu yg baik\r\n- menjadi istri yg baik\r\n- menjadi menantu yang baik\r\n- memecahkan permasalahan dengan baik dan lebih terbuka\r\n- bisa bergaul baik dengan tetangga dan keluarga', 1, 0, 1, 1, '- Beragama islam\r\n- Taat kepada Allah\r\n- Taat pada orang tua\r\n- Cinta keluarga dan menafkahinya\r\n- Taat pada agamanya\r\n- Menjadi contoh untuk istri dan anaknya\r\n- Memiliki karakter kebapakan\r\n- Setia dan jujur\r\n- Memiliki passion terhadap pekerjaannya\r\n- Tidak suka bermalas-malasan apalagi maniak game atau anime \r\n- Pekerja keras\r\n- Penyabar dengan situasi\r\n- Menerima kekurangan\r\n- Tidak banyak tuntutan dan bisa saling pengertian\r\n- Terbuka pada masalah dan mencari solusi bersama\r\n', 'Seiman, taat agama, menjadi panutan anak istri dan pekerja keras', 'Sederhana ', 'belum terpikirkan', 'Suami bekerja mencari nafkah dan istri mengurus pekerjaan rumah dan anak, suami yang bisa menjadi panutan anak dan istrinya, bisa bergaul antar keluarga masing masing, bekerja keras mewujudkan visi dan misi walaupun harus dari 0', 'Ada keinginan untuk bekerja dibidang pengairan nanti jika dibutuhkan untuk memenuhi kebutuhan, namun bagaimana istri mengikuti perintah suami nantinya harus bekerja atau jadi ibu rumah tangga.', 'Mengajari anak dari kecil tentang agama, menerapkan peran ibu dan ayah pada pertumbuhan mental anak, mengajari tentang pelajaran disekolahnya, mengantarkan dia sekolah, menghabiskan waktu bersama anak ', 'Untuk kebutuhan sehari-hari bisa suami menyisihkan gajinya kebutuhan tiap bulannya atau bisa kondisional dan menutupi kebutuhan masing masing', '1. Berhijrah dan Lulus kuliah\r\n2. Bertemu jodoh\r\n3. Kerja jika diperlukan untuk biaya pernikahan\r\n4. Menikah\r\n5. Punya anak', '- punya keluarga\r\n- punya rumah sendiri\r\n- kumpul 2 keluarga \r\n- Menjadi ibu rumah tangga dan bisa mengajari anak dirumah', 'Visi : menjadi makhluk dengan ketaatan kepada Allah \r\nMisi : \r\n- membahagiakan orang tua didunia dan akhiratnya\r\n- bisa menafkahi orang tua\r\n- menaikkan haji orang tua \r\n- menjadi istri yang taat suami\r\n- menjadi ibu yang baik untuk anak', '082302081762'),
(174, 'Amelia Husnan', 'Surabaya', '1995-09-24', 157, 54, 'O', 'Tidak', 'Mahasiswi', 3, 'Amir Husnan', 'Madura', 'Ritha Hendrawaty', 'Jawa', 'ya', 'Jln. MT haryono no 139', 'SDN Badean 1', 'SMP Negeri 4 Bondowoso', 'SMA Negeri 2 Bondowoso 2010-2013', 'Universitas Brawijaya', 'Tidak ada', 'Anggota divisi kaderisasi', '- Bendahara program sanitasi desa\r\n- Penari di acara hari air dunia\r\n- Penanggung jawab dan Steering comittee  program pembinaan\r\n- Penanggung jawab acara kompetisi bangunan air ', 'Tidak kerja hanya pernah magang proyek di kampus', 'Aku adalah mahasiswi tingkat akhir yang sedang berjuang untuk lulus dan bercita-cita menjadi ibu rumah tangga. Walaupun begitu tidak ada yang salah kan untuk cita-cita ini?', 'Berjuang dengan ridho Allah', 'Memasak', 'Kutinggalkan dia karena dia', 'Kajian dakwah online', 'Muhammad SAW tepatnya tapi dengan segala kekurangan saya jika banyak lupa', 'Memasak untuk menyiapkan buka puasa, Tahajud, Olahraga pagi, Belanja ke pasar, Mendengar Kajian di Instagram, nonton film, cfd an dengan sahabat, berkumpul dengan sahabat, tutorial masak dengan teman', 'Tidak tepat waktu, menunggu, berghibah', 'tepat waktu, kesederhanaan, peka, penyayang, senyum dan tertawa', 'Tidak sabaran, gampang baper karena terlalu peka, kurang penyabar, emosi sesaat', 'tidak', 'tidak', 'Ayahku adalah staf perencanaan dari dinas pu pengairan. Beliau sebagai donatur dan penyalur biaya kuliah saya saat diperkuliahan ini. beliau taat agama dan pekerja keras,  pengertian, humoris dan serius. Beliau keturunan kyai dari madura. Beliau jarang menampakkan kasih sayangnya melalui kata2 tapi melalui tindakan. ', 'Ibu saya dari surabaya dan beliau adalah ibu rumah tangga dan sangat serius terkadang bisa tertawa dan bercanda, jago memasak dan bikin kue, orangnya cinta kebersihan, terorganisir dan suka memberi solusi dan nasihat. ', 'Adik saya sudah lulus sma tapi tidak ingin melanjutkan kuliah. Aktivitasnya saat ini bekerja ikut dengan ayah saya dikantor dan menemani ibu saya saat dirumah. Alasannya tidak berkuliah yaitu agar ibu tidak kesepian dirumah karena saya harus kuliah diluar kota', 'tidak', 'sup', 'air putih', 'jam 10', 'alhamdulillah', 'tahajud dan puasa senin kamis', 'bisa', 'jarang', 'kajian dikampus saja tapi tidak sering', 'memasak dan nonton film', 'kemana mana dengan sahabat saja. karena saya tipikal susah bergaul jika tidak cocok dengan karakter saya.', '1x untuk didunia dan di akhirat', 'belum', 'mental dan pengetahuan', 'jika ada ', 'Sampai lulus kuliah', 'Visi : mewujudkan keluarga yang sakinah mawaddah dan warohmah dalam mencari surga Allah\r\nMisi :\r\n- menjadi anak yang baik kepada orang tuanya\r\n- menjadi istri yang baik untuk suaminya\r\n- menjadi ibu yang baik untuk anak-anaknya\r\n- menjaga keharmonisan antar keluarga\r\n- mendidik dan mengajari anak terlebih dari sekolahnya\r\n', 1, 1, 1, 1, '-Islam Agamanya\r\n- Rajin beribadah dan taat beragama\r\n- Tidak pernah lupa sholat dan selalu mengingatkan\r\n- Bisa mengaji untuk mengajarkan anaknya kelak\r\n- Taat dan menyayangi kedua orang tua\r\n- Pekerja keras dan tidak malas2an\r\n- Menjaga anak dan istri serta mampu membiayai secara finansial\r\n- penyabar\r\n- Setia\r\n- Pengertian dan bisa memahami situasi\r\n- Terbuka kepada masalahnya dan bisa memecahkan solusi\r\n- Sederhana tidak neko2\r\n- Bukan maniak game dan anime\r\n- Bisa bergaul dengan antar keluarga dan sesama\r\n- Dewasa\r\n- Menerima segala kekurangan\r\n- memiliki prinsip hidup', 'Seiman, rajin beribadah dan taat agama, taat pada orang tua, sesuai dengan keinginan anaknya', 'Sederhana ', 'belum terpikirkan', 'keluarga yang bisa saling mengisi kekurangan masing2, mendidik dan mengajar anak dengan peran orang tua yang dominan selain dari sekolah dan lingkungan, bisa bersama2 sholat berjamaah dirumah atau dimasjid, bisa memasakkan makanan tiap hari saat bangun dan akan pergi bekerja, bisa meluangkan waktu bermain dengan anaknya, meluangkan waktu bersilaturahmi dengan keluarga, terbuka dalam segala situasi dan masalah', 'Jika dibutuhkan dalam memenuhi kebutuhan untuk jadi wanita karir jika tidak tergantung suami dan menurutinya.', '- mengenalkan anak ttg agama sejak dini\r\n- setiap hari meluangkan waktu berbicara dan bermain bersama anak\r\n- mengajarkan pendidikan karakter dan mental\r\n- bisa mengantar dan menjemput anak ke sekolah \r\n- mengajarkan pelajaran sekolah dan kesulitannya', 'dengan suami nanti menyisihkan sebagian gajinya untuk kebutuhan sehari-hari  ', '1. Lulus kuliah\r\n2. Kerja untuk biaya hidup sendir\r\n3. Menemukan pasangan hidup\r\n4. Menikah\r\n5. Menata finansial san mental siap tidak memiliki anak', '1. Berkeluarga\r\n2. Mandiri\r\n3. Punya rumah sendiri', 'Visi : Menjadi makhluk dalam perjalanan menuju surga Allah\r\nMisi :\r\n- Membahagiakan orang tua\r\n- Menaikkan haji orang tua\r\n- bisa menyisihkan uang untuk orang tua\r\n- Memiliki keluarga dengan visi yang sama', '082302081762 ');
