(187, 'Ahmad syamsudin', 'Nganjuk', '1984-03-29', 165, 53, 'A', 'Tidak', 'Koki', 3, 'Mukiran', 'Jawa', 'Sanem', 'Jawa', 'ya', 'Ds putukrejo.kec Leceret.kab NGANJUK', 'Sdn putukrejo 1990 - 1996', 'MTsN NGANJUK 1996 -1999', 'SMK MUHAMMADIYAH NGANJUK 1999 - 2002', 'Tidak', 'No', 'Psht', 'No', 'Restoran', 'G banyak ngomong.pekerja keras.suka menolong.g mudah akrab sama cewek.                                                                                   ', 'Semua d esensikan ke ibadah', 'No', 'Buku" reliji', 'Cak nun.com', 'Cak Nun.soekarno', 'Bekerja', 'D bohingi', 'Pekerja keras.suka menolong.', 'Pemalu.kurang pd', 'No', 'No', 'Sabar.g suka ngomongin orang.g banyak ngomong.tekun.rajin ibadah.                                         Mudah iba.                                      ', 'Pekerja keras.pemalu.sedikit cerewet.suka menolong.                                                                                                       ', 'Baik.rukun..suka menolong sesama.                                                                                                                           ', 'Tidak', 'Nasi pecel', 'Air putih.teh', '00.00', 'Rajin', 'Puasa senin kamis.sholat fajar.dzikir pagi dan petang', 'Bisa', 'Surat" pendek.', 'Rukyah aswaja', 'Baca', 'Baik semua', 'Beridah untuk mendapatkan ridha Allah', 'Sudah', 'Kesabaran.', 'Sudah', 'Segara bila cocok.', 'Membangun keluarga islami', -1, 0, -1, -1, 'Taat pd Tuhanya', 'Solehah', 'Sederhana', 'Nganjuk', 'Islami', 'WiraswastA.usaha kuliner', 'Nilai" islam.', 'Terkoordinasi dgn istri.tdk boros.hrs menabung.', 'Menikah.', 'Memiliki rumah', 'Semua d niatkn ibadah', '085 65 99999 67'),
(188, 'Eni indriati', 'Sragen', '1990-02-02', 150, 39, 'B', 'Tidak', 'Guru', 3, 'Tri harjono', 'Jawa', 'Sutarni', 'Jawa', 'ya', 'Perum bumi indah tahap 5 blok ki no.14, Tangerang', 'SDN Pangadegan 4', 'SMPN 2 PASARKEMIS 2003-2005', 'SMAN 11 TANGERANG 2005-2008', 'S1 Pendidikan biologi UNTIRTA 2008-2014', 'Sm3t 2016, namun saya tidak lanjut. Karena orang tua tidak mengizinkan', 'Tidak pernah', 'Bendahara study tour kampus. Namun saya tidak aktif. Karena tidak sepaham. Selain itu, saya aktif dikepanitiaan acara di sekolah. Yang mengundang bupatikabupaten tangerang dan pejabat2 daerah, kepsek, guru, dan lainnya. Saya pun aktif sebagai guru pendamping jika lomba2 di sekolah. Bagi saya, murid saya harus lebih hebat dari saya.', 'Lembaga bimbel CEC cab.tangerang, Bimbel Quantum kids  Cilegon.', 'Saya anak pertama dari 3 bersaudara. Saya perempuan satu2nya. Orang lain menilai saya, wanita yang jutek dan judes. Bagi saya itu hal biasa. Saya wanita keras dalam prinsip. Jika saya punya keinginan, 80% harus dapat dicapai. Saya oreng yang detail dalam melakukan pekerjaan, dalam menyelesaikan masalah. Saya bawel, saya humoris, dan tidak mudah tersinggung. Meskipun wajah saya terkesan jutek. Saya wanita yang sabar dan penurut. Meskipun terkdang saya ngeyel. Saya sangat senang dengan orang baru dan dunia baru. Termasuk dunia pendidikan. Bagi saya orang tua dan adik2 saya adalah segalanya', 'Menjadi yang baik diantara yang terbaik', 'Membaca, belajar, berdiskusi', 'Buku tentang islam dan pendidikan anak', 'Facebook', 'Ust.jefri', 'Melakukan pekerjaan rumah, mengajar', 'Menunggu', 'Sabar, penurut, apa adanya, tidak mudah tersinggung, humoris', 'Keras kepala, egois, ngeyel, cuek', 'Tidak', 'Liqo', 'Bpk saya bukan orang yang berlatarbelekang dengan agama yang baik. Dulu sebelum di uji. Bpk tidak pernah sholat 5 waktu. Hanya sholat ketika idul fitri. Bpk orang yang pasif. Di rumah ini dominan dengan sosok ibu. Bpk sosok yang tidak pernah marah. Bagi saya itu luar biasa. Lelaki yang super sabar. Bpk selalu memandang sesuatu dengan logikanya.', 'Ibu sosok yang dominan di rumah. Ibu yang luar biasa sosok ibu. Ibu sangat sabar. Sabar dan sabar. Ibu tidak pernah menuntut materi dari anaknya. Sosok yang perhatian. Pengertian. ', 'Adik saya semua laki2. Mereka adik yang tidak mampu diandalkan. Mereka terlalu asik dengan dunia mereka sendiri. Terlalu sibuk main dan main. Sekalipun begitu, terkadang mereka care. Kami tidak pernah bertengkar.', 'Tidak', 'Masakan jawa', 'Air putih dan teh manis', '22.00', 'Alhamdulillah diawal waktu', 'Tahajud, dzuha, puasa, istikhoroh', 'Iya', 'Hafalan surat2 pendek', 'Liqo dan kajian di istiqlal', 'Membaca', 'Alhamdulillah baik dan saya tidak membeda2kan teman', 'Pernikahan adalah hidup dan kehidupan', 'Insya Allah siap', 'Menabung dan memperbaiki diri misalnya memasak, ik', 'Sangat mengizinkan', '3bulan', 'Visi: Membagun keluarga islam\r\nMisi: memilih imam yang memahami agama, yang tau hak dan kewajibannya sebagai suami. Memperkenalkan anak dengan islam seperti mengajaknya ke kajian atau mengajak ke masjid. Membiasakan sholat berjamaah khususnya diwaktu subuh dan isya. Menyisakan sebagian rejeki untuk investasi orang tua dan amal. ', 1, 1, 0, 1, 'Yang agamanya baik. Setidaknya memahami hak dan kewajibannya. Yang mampu bertanggung jawab menafkahi anak dan istrinya. Yang menganggap ibu saya adalah ibunya. Yang SETIA', 'Setia, sayang terhadap saya, bertanggung jawab, mapan dalam arti berpenghasilan tetap, bersuku jawa', 'Sederhana dengan adat jawa. Karena, pernikahan sesunggunya setelah menikah', 'Bersama suami', 'Sakinah, mawaddah, warahmah. Yang harmonis, yang terbuka. Saling pengertian. Saling melengkapi dan menerima apa adanya. Keluarga yang islami. ', 'Guru, ibu rumah tangga', 'Mengajarkan anak tentang islam seperti membiasakan membaca doa sebelum beraktivitas. Memperkenalkan anak pada rasul seperti menceritakan nabi. Menghafal alquran. Mengajak ke kajian bulanan  atau ke masjid ', 'Mendahului sandang, pangan dan papan. Mendahului kebutuhan yang penting dan mendesak. Semua kebutuhan penting, tapi tidak semua kebutuhan mendesak. ', 'Menikah, memiliki anak, memiliki rumah', 'Memiliki kebutuhan tersier. Misalnya kendaraan', 'Visi: menjadi yang baik diantara yang terbaik\r\nMisi: melakukan semua kegiatan semaksimal mungkin dengan tidak memaksakan kemampuan diri. Berdoa dan berpasrah, karena ada tangan Allah yang akan bekerja', '087771588591');
